import { Bar, BarChart, ResponsiveContainer, XAxis, YAxis } from "recharts";
import IProfissional from "../../types/IProfissional";
import IConsulta from "../../types/IConsulta";
import useDadosGrafico from "./useDadosGrafico";

interface Props{
    profissionais: IProfissional[] | null,
    consultas: IConsulta[] | null
}

interface IDados{
    nome: string,
    consultas: number

}


function Grafico({profissionais, consultas} : Props){
    let dados: Array<IDados> = useDadosGrafico({profissionais, consultas});
    return(
        <ResponsiveContainer width='100%' height={350}>
            <BarChart layout="vertical" data={dados} margin={{top:25, left:40,right:40, bottom:25}}>
                <XAxis type="number">
                </XAxis>
                <YAxis type="category" dataKey="nome">
                </YAxis>
                <Bar dataKey="consultas" fill="#083860" barSize={30}></Bar>
            </BarChart>
        </ResponsiveContainer>
    )
}

export default Grafico;
